            <p>チャットしてく？？</p>
        </div>
        <SignInArea />
        <style jsx>{`
            .page {
                width: 100%;
                height: 100vh;
                max-width: 1280px;
                display: flex;
            }
            .ImageArea {
                position: rerative;
                width: 70%;
            }
            img {
                width: 100%;
                height: 100%;
                object-fit: cover;
            }
            p {
                position: absolute;
                top: 20%;
